const FinalData = (props) => {

    {props.data.map((data, index) => {
        return (
            <tr key={`${index}`}>
              <td>{data.empOne}</td>
              <td>{data.empTwo}</td>
              
              <td>{data.daysWorkedTogether}</td>
               
            </tr>
        );
    })}
  
}

export default FinalData;
